PROBLEM: 'Randy drove the first third of his trip on a gravel road, the next '$20$" miles on pavement, and the remaining one-fifth on a dirt road. In miles, how long was Randy's trip?\n"
=======
CHOICES:
[A]: 30
[B]: \frac{400}{11}
[C]: \frac{75}{2}
[D]: 40
[E]: \frac{300}{7}

PROBLEM: 'Susie pays for '$4$' muffins and '$3$' bananas. Calvin spends twice as much paying for '$2$' muffins and '$16$' bananas. A muffin is how many times as expensive as a banana?\n'
=======
CHOICES:
[A]: \frac{3}{2}
[B]: \frac{5}{3}
[C]: \frac{7}{4}
[D]: 2
[E]: \frac{13}{4}

PROBLEM: 'Real numbers '$a$' and '$b$' are chosen with '$1<a<b$' such that no triangle with positive area has side lengths '$1$', '$a$', and '$b$' or '$\frac{1}{b}$', '$\frac{1}{a}$', and '$1$'. What is the smallest possible value of '$b$'?\n'
=======
CHOICES:
[A]: \frac{3+\sqrt{3}}{2}
[B]: \frac{5}{2}
[C]: \frac{3+\sqrt{5}}{2}
[D]: \frac{3+\sqrt{6}}{2}
[E]: 3

PROBLEM: 'When '$p = \sum\limits_{k=1}^{6} k \text{ ln }{k}$', the number '$e^p$' is an integer.  What is the largest power of '$2$' that is a factor of '$e^p$'?\n'
=======
CHOICES:
[A]: 2^{12}
[B]: 2^{14}
[C]: 2^{16}
[D]: 2^{18}
[E]: 2^{20}
